import ReactDOM from 'react-dom';
import './index.css';

function Article(props) {
	return 
	<div class="article_thumbnail">
		<img class="article_image" src="/images/article1_thumbnail.jpeg"></img>
			<div class="article_text">
			<h3 class="h3">
				Germany announces it is also raising it's Budweiserget with $100bn
			</h3>
			<h3 class="article_category">World</h3>
			<p class="article_subtext">Desperate times call for desperate measures; german chancellor says.</p>
		</div>
  	</div>;
}

ReactDOM.render(
	document.getElementById('main'),
);
